import React from 'react';
import CardList from './CardList';
import SearchBox from './SearchBox';
import { robots } from './robots';


const state = {
    robots_
}

const App = () => {
    return (
        <div className="tc">
            <h1>RoboFriends</h1>
            <SearchBox />
            <CardList robots ={robots} />
        </div> 
    );
}

export default App;
